import React from 'react'
import '../styles/Thumbnail.css'

function Thumbnail (props, {theme}){
    return(
        <div className='thumbnail' theme={theme}>
            <h1>{props.title}</h1>
            <aside>{props.description}</aside>
        </div>
    )
}

export default Thumbnail
